import React from "react";
import { Modal } from "antd";
const PersonModal = ({ visible, onCancel, onhandleUpdate }) => {
  return (
    <Modal visible={visible} onCancel={onCancel} onOk={onhandleUpdate}></Modal>
  );
};

export default PersonModal;
